import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="row">
          <div className="col-sm-4" >.col-sm-4</div>
          <div className="col-sm-4" >.col-sm-4</div>
          <div className="col-sm-4" >.col-sm-4</div>
        </div>
      </header>
    </div>
  );
}

export default App;
